window.bookSummaryJSON = "<p>She wasn't looking to fall in love with one man. Never mind two.</p> <p>Juliet Reece grew up in the shadow of her seemingly perfect older sister, Margo Reece. While Juliet's wealthy, blue-blood parents dealt with infidelity, Juliet fought for normalcy. Now she's the bassist in Warning Sign, a band on the rise, and she finally feels like she's making space for herself in the world. It's her time to shine, and she's ready to have fun and focus on her career.</p> <p>Until Randy \"Sparks\" Pruitt nearly blows up her life. Literally.</p> <p>She can't stand the guy. She definitely hasn't fantasized about gripping a handful of his hair and - no. Not happening.</p> <p>Then there's Tristan Eves, Sparks' new friend. He's the exact opposite of Sparks. Playful. Naughty. Arousing.</p> <p>Suddenly, she's on the verge of something wilder than she's ever experienced before. Two seductive men, hers for the taking - if she can handle the heat.</p> <p><b>If double trouble is dangerous, watch out for the power of three....</b></p>"; 
